import Link from "next/link";
const Navbar = () => (
  <div>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/hello">
          <a>Hello World</a>
        </Link>
      </li>
    </ul>

   {/*  <style jsx>
